import React from "react";

import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import classes from './InterviewListCard.module.css';

const InterviewListCard = (props) => {
    return (
        <div className={classes.card}>
            <Card sx={{ minWidth: 275 }}>
                <CardContent>
                    <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
                    {props.interviewList.date}
                    </Typography>
                    <Typography variant="h6" component="div">
                    Start Time: {props.interviewList.startTime}
                    </Typography>
                    <Typography variant="h6" component="div">
                    End Time: {props.interviewList.endTime}
                    </Typography>
                    <Typography variant="body2">
                    Interviewer(s): {props.interviewList.interviewers.map((value) => { return <h7>{value.name} |</h7>})}
                    </Typography>
                    <Typography variant="body2">
                    Participants(s): {props.interviewList.participants.map((value) => { return <h7>{value.name} </h7>})}
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button size="small">Edit</Button>
                </CardActions>
            </Card>
        </div>
    );
};

export default InterviewListCard
